def get_sol(): return Solution()
class Solution2:
    # tle
    def numberOfCombinations(self, s: str) -> int:
        M=10**9+7
        @cache
        def dfs(start, prev):
            if start==n:
                return 1
            if s[start]== '0':
                return 0
            res=0
            for i in range(start+1, n+1):
                tmp=int(s[start:i])
                if tmp>=prev:
                    res+=dfs(i,tmp)
                    res%=M
            return res

        n=len(s)
        return dfs(0,-1)

